import React from "react";

const LandingPage = () => {
  return (
    <div>
      <div className="split landingpgone">
        <div className="logoposition">
          <img className="whitelogo" alt="Logo" src="./images/logowhite.png" />
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
